function ReglasNegocio(){
    return <>
     <div className = "column" id="contenedor_rn">
            <h1>Reglas de Negocio</h1>

            <p> Quieres saber cómo interactua la página con las interacciones del usuario? Tanto su front-end como back-end... </p>
            <button id="reglas">Ver reglas de negocio</button>
            </div>
    </>
}

const ChangeButtonClass = async (boton) => {
    if (boton.className === 'simular1') {
        boton.className = "simular2";
        boton.value = 'true';
    }
    else {
        boton.className = "simular1";
        boton.value = 'false';
    }

}

export default ReglasNegocio;
